## Description
Write data by users without permission to create schema throws load tsfile exception

## Reproduce
IoTDB Cli:
create timeseries root.test.g_0.d_0.s_0 with datatype=DOUBLE,encoding=PLAIN compression=SNAPPY;
CREATE USER user01 'pass1234';
GRANT WRITE_DATA ON root.** TO USER user01; 
list privileges of user user01;

./tools/load-tsfile.sh -f /data/tsfile  --onSuccess none -h 127.0.0.1-p 6667 -u user01 -pw pass1234

Msg: 701: Auto create or verify schema error when executing statement LoadTsFileStatement{file=/data/tsfile, deleteAfterLoad=false, databaseLevel=1, verifySchema=true, tsFiles Size=1}. 

## Solution
Before checking user's authority, we need to get all databases in cluster and filter them out of the loaded tsfile to avoid triggering the no authority to create database exception.
在检查用户权限前，我们需要先获得集群中存储的database，把他们从load的tsfile中过滤走，以免触发无创建database权限的报错

correct the wrong fix logic in https://github.com/apache/iotdb/pull/10060

logic now: When generate statement, don't remove back_quotes any more; 
after placeholders applied, we will remove back_quotes if necessary or check if the node name is legal.
